  \"2013-03-28T01:14:46.568725\",\n\t\"name\": \"dnr-state-forest-roads-wheels-database\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Roads administered by the Commissioner
  of Natural Resources to provide access to lands administered by the Division of
  Forestry. These roads are generally open to the public for recreational use. Some
  of the segments in this shapefile are components of County administered forest road
  systems which cross State land. State Forest Roads are classified as either system
  roads or minimum maintenance roads. System roads are generally well maintained and
  capable of supporting low-clearance highway licensed vehicles. Minimum maintenance
  roads are not capable of sustaining routine traffic by highway licensed vehicles.
  They are posted with signs which state \"Road may be impassable. Travel at your
  own risk\".\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
